'                           msg = msg.replace("#MINLENGTH#", args.minimum);',
'                           msg = msg.replace("#REMAININGCHARS#", args.minimum - args.input.length);',
'                           return msg;',
'                         },'';',
'    end if;',
'    if l_loading_more_results_msg is not null then',
