'                    p_request: "PLUGIN='' || apex_plugin.get_ajax_identifier || ''"',
'                  };',
'                },',
'          processResults: function(data, params) {',
'                            var select2Data = $.map(data.row, function(obj) {',
'                              obj.id = obj.R;',
'                              obj.text = obj.D;',
'                              return obj;',
'                            });',
'',
'                            return {',
'                              results: select2Data,',
'                              pagination: { more: data.more }',
'                            };',
'                          },',
'          cache: true',
'        },',
'        escapeMarkup: function(markup) { return markup; },'';',
