'    l_code := l_code || ''})'';',
'',
'    if l_search_logic != gco_contains_ignore_case then',
'      l_code := l_code || ''});'';',
'    else',
'      l_code := l_code || '';'';',
'    end if;',
'',
'    return l_code;',
'  end get_select2_constructor;',
'',
'',
'  function get_sortable_constructor',
