'    elsif l_display_values.count > 1 then',
'      htp.p(''',
'        <ul id="'' || p_item.name || ''_DISPLAY"',
'          class="display_only '' || p_item.element_css_classes || ''"'' ||',
'          p_item.element_attributes || ''>'');',
'',
'      for i in 1 .. l_display_values.count loop',
