'        l_optimize_refresh_condition := l_optimize_refresh_condition || '' || $("'' || l_cascade_parent_items(i) || ''").val() === ""'';',
'      end loop;',
'',
'      l_onload_code := l_onload_code || ''',
'        var item = $("'' || l_item_jq || ''");',
'        if ('' || l_optimize_refresh_condition || '') {',
'          item.val("").trigger("change");',
