,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    V_INTV_TIME NUMBER(2);',
'BEGIN',
'SELECT MAX(T_CAPTCHA_INTERVAL_TIME) INTO V_INTV_TIME FROM T07202;',
'HTP.P(''',
'<!-- Count down redirect using CSS -->',
'<style type="text/css">',
'	.cntdown{',
'		text-align:center;',
'		font-size:14px;',
'		font-weight:bold;',
'		color:red;',
'		border:1px solid #eee;',
'		border-radius:10px;',
'		margin:20px auto;',
'		width:100px;',
'		padding:10px;',
'		}',
'	',
'	.msg{',
'		color:#999;',
'		text-align:center;',
'		width:100%;',
'		margin:10px auto;',
'	}',
'</style>',
'',
'<div class="cntdown">',
'     <span id="countdown">60</span>',
''');',
'if :P0_LANG=''BN'' THEN HTP.P(''সেকেন্ড''); ELSE HTP.P(''Seconds''); END IF;',
'htp.p(''',
'</div>',
'',
'<div class="msg">',
''');',
'    IF :P0_LANG=''BN'' THEN',
'      HTP.P(''দয়া করে ''|| V_INTV_TIME ||'' সেকেন্ডের মধ্যে আপনার মোবাইল ফোনে পাঠানো যাচাইকরণ কোড দিন অন্যথায় আপনি আগের পৃষ্ঠায় ফিরে যাবেন !!'');',
'    ELSE',
'      HTP.P(''Please give varification code that has been sent to your mobile within''|| V_INTV_TIME ||''seconds otherwise you will go back to the previous page!!'');',
'    END IF;',
'HTP.P(''',
'</div>',
'<!--Count down redirect JavaScript -->',
' <script type="text/javascript">',
'',
'// Total seconds to wait',
' var seconds = ''|| V_INTV_TIME ||'';',
'',
'function countdown() {',
'     seconds = seconds - 1;',
'     if (seconds < 0) {',
'     // Chnage your redirection link here',
'         window.location = "f?p=&APP_ID.:1:&SESSION.";',
'',
'     } else {',
'     // Update remaining seconds',
'     document.getElementById("countdown").innerHTML = seconds;',
'     // Count down using javascript',
'     window.setTimeout("countdown()", 1000);',
'     }',
' }',
'countdown();',
'',
'</script>',
''');',
'END;'))
,p_plug_source_type=>'NATIVE_PLSQL'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
);
